import React, { useState } from "react";
import './VideojuegoForm.css';


const CarritoBtn = ({ videojuego }) => {

    const addCart = async

    return (
        <div className="col-sm-12 col-md-6 col-lg-6" id="contenedor_botones">
            <a href="carrito" className="btn btn-success btn-lg" onclick="addCart()">Agregar a carrito (${videojuego.precio.valor})</a>
        </div>
    );
};

export default CarritoBtn;
